import React from "react";
import "../../App.css"
import Navbar from "../nav/topnav";

function Logo (){
    return(
        <header>
           <div className="container">
            <div className="row">
            <div className="brand-name">
            <a href ="/" className="logo">LA</a>
            </div>
            <Navbar />
        </div>
        </div>
    </header>
    )
}

export default Logo;
